  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:21.994284\",\n\t\"name\": \"sam-d-hamilton-noxubee-wilderness-a-report-on-wilderness-character-monitoring\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a detailed summary
  of the baseline wilderness character assessment completed for the Sam D. Hamilton
  Noxubee National Wildlife Refuge Wilderness, located in Mississippi. The purpose
  of this report is multi-dimensional. It establishes a wilderness character monitoring
  program for the Noxubee Wilderness and provides baseline data for future trend analysis.
  An understanding of the information in this report may also aid resource specialists
  by informing management decisions within the Noxubee Wilderness. Finally, this report
  is meant to accompany and explain the quantitative results of Noxubee wilderness
  character assessment that have been entered into a national wilderness character
  monitoring database.  A total of 21 measures were used to assess the following:
  untrammeled quality, natural quality, undeveloped quality, and solitude or primitive
  and unconfined recreation quality.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
